export const patientName = (firstName: any, lastName: any) => {
  return firstName + ' ' + lastName;
};

export const sex = (sex: string) => {
  if (sex == 'F') {
    return 'Female';
  }
  if (sex == 'M') {
    return 'Male';
  } else return 'N/A';
};

export const date = (date: any) => {
  return new Date(date).toDateString;
};
